    title = r'<title> (.*?)\| 我的Galgame资源发布站</title>'
    img1 = re.compile(title)
    html1 = content.decode('utf-8')  # python3
    imglist1 = re.findall(img1, html1)
    for i in imglist1:
        print(i)

    #提取密码：<span style="color: #ff0000;">A553</span></span>
