    img2 = re.compile(title2)
    html2 = content.decode('utf-8')  # python3
    imglist2 = re.findall(img2, html2)
    for i in imglist2:
        print(i)

    reg = r'MD5: (\w{32})<' #括号里面就是匹配结果
    img = re.compile(reg)
    html = content.decode('utf-8')  # python3
    imglist = re.findall(img, html)
    for i in imglist:
        print(i)
    print("")

